  let client = clients.map(x => {
    let {id, img, des, position, name} = x;
    return (
      <Clients
        key = {id}
        img = {img}
        des = {des}
        position = {position}
        
      />
    )
  })

  return (
    <div className='grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 items-center bg-white' style={{border : "1px solid red"}}>
      {client}
    </div>
  )
}

